// methods: GET, POST DELETE, PUT
// status: 200, 500, 404




import React from "react";

function app() {

    const url = `https://api.open-meteo.com/v1/forecast?
    latitude=52.52&
    longitude=13.41&
    current=temperature_2m`

    fetch(url).then((data) =>{
        if(data.status === 200) {
            return data.json();
        }
        else {
            console.error('Its not ok!')
        }
        console.log(data)
        }).then((info => {
            console.log(info)
        }))
    }

export default app
